import React from "react";

const Header = (props) => {
	return (
		<div>
			<h1>{props.course}</h1>
		</div>
	);
};

const App = () => {
	const course = "Half stack app dev";
	const part1 = "Fundamentals of React";
	const exercise1 = 10;
	const part2 = "Using props to pass data";
	const exercises2 = 7;
	const part3 = "State of a component";
	const exercises3 = 14;

	return (
		<div>
			<Header course={course} />
			<p>
				{part1} {exercise1}
			</p>
			<p>
				{part2} {exercises2}
			</p>
			<p>
				{part3} {exercises3}
			</p>
			<p>Number of exercises {exercise1 + exercises2 + exercises3}</p>
		</div>
	);
};

export default App;
